import { Component } from "react";
import Mountain1 from "../assets/1.jpg";
import Mountain2 from "../assets/3.jpg";
import Mountain3 from "../assets/5.jpg";
import Mountain4 from "../assets/8.jpg";
import "./AccomodationStyles.css";

class PropertyData extends Component {
  render() {
    return (
      <div>
        <div className="property">
      <h1>Apartment Of The Week</h1>
      <p>Every week we select a property that was booked and most with positive reviews</p>
      <div className="first-des">
        <div className="des-text">
          <h2>Jewel City, Maboneng, Johannesburg</h2>
          <p>Located in the city's vibiest section where the Night Life is the order of the day, Jewel City is one of the most beautiful accomodation provided by iThemba Properties and it is made up of 3 sections namely the "Diamond", Emerald and Onyx. No wonder they call it Jewel City, this place is mostly perfect for Creatives, Bachelors and Young Couples who want to live in the vibe of Johannesburg. Book today for their 1st month Rent Free promo before it ends!</p>
        </div>
        <div className="image">
          <img alt="img" src={Mountain1}/>
          <img alt="img" src={Mountain3}/>
        </div>
      </div>
    </div>
      </div>
    );
  }
}

export default PropertyData;
